import React from 'react';

import * as AiIcons from "react-icons/ai";
import * as ImIcons from "react-icons/im";





export const navbarData = [
   {name: "Home", 
   path: "/",
   icon: <AiIcons.AiFillHome/>},
   {name: "Login", 
   path: "/login",
   icon:<AiIcons.AiOutlineLogin />},
   {name: "Sign Up", 
   path: "/signup",
   icon: <ImIcons.ImEnter/> },
   {name: "User Dashboard",
   path: "/user"}
]
